import React, { Fragment } from "react";
import { connect } from "react-redux";
import SideBar from "../layout/Sidebar";

const Profile = ({ auth }) => {
  const { user } = auth;

  if (auth.loading) {
    return <h2 className='loading'>Loading...</h2>;
  }

  return (
    <Fragment>
      <SideBar />
      <div className='main-container'>
        <div className='main-content-container'>
          <div id='profile-container'>
            <div id='profile-basic'>
              <div id='profile-picture'></div>
              <div id='profile-name'></div>
              <div id='profile-location'></div>
              <div id='profile-socials'>
                <div className='social-button'></div>
                <div className='social-button'></div>
                <div className='social-button'></div>
              </div>
              <div id='profile-button'></div>
            </div>
            <div id='profile-background'>
              <div id='profile-bio'></div>
              <div id='profile-overlay'></div>
              <div id='profile-options'></div>
            </div>
            <div id='profile-stats'>
              <div id='profile-views'></div>
              <div id='profile-followers'></div>
              <div id='profile-photos-sold'></div>
              <div id='profile-average-price'></div>
              <div id='profile-following'></div>
            </div>
          </div>
        </div>
      </div>
    </Fragment>
  );
};

const mapStateToProps = state => ({
  auth: state.authReducer
});

export default connect(mapStateToProps)(Profile);
